{"staticAdditionalInfo":"<p>Europe’s blue economy and especially SMEs play a crucial role in supporting coastal communities and in decarbonising our economy. This call for proposals aims to accelerate the sustainable development of the blue economy SMEs across the European Union.</p><p>The Commission's first economic reports on the blue economy in 2018 and 2019 [1] shows that innovative and emerging maritime sectors, such as the blue bio-economy, and other sustainably managed ones, have a growth potential that can out-perform traditionally managed sectors and create new business opportunities and maritime jobs. However, a study [2] to support investment in the blue economy conducted by the Commission shows that there are considerable funding gaps in scaling up promising projects from pilot to demonstration phase and to help Blue Economy SMEs and start-ups achieve the ‘next stage’ of business growth.</p><p>The study concluded that both more EU investment support is needed, and that finance sector relevant for the Blue Economy needs to be encouraged to invest more in emerging maritime businesses. In particular, it shows that businesses in innovative, sustainable and circular blue economy sectors, while receiving financial support, including funding from Horizon 2020, lack support on the path towards market entry and scaling up.</p><p>Therefore, grants supported under the Blue Economy SME Window call for proposals 2019 will address the challenge of developing and bringing to market new products, services, and business models for SMEs that could ultimately create profitable activities.</p><p>This will be part of a new comprehensive service package offered by the ‘BlueInvest platform’ that supports investment readiness and access to finance for early-stage businesses, SMEs and scale-ups in the blue economy. Hence the branding of the grants as ‘BlueInvest Grants’. For more info on the platform services: http://<a href="http://www.blue-invest/">www.blue-invest.eu</a></p><p>These grants will support projects that accelerate innovation in the blue economy, demonstrate high potential in terms of company competitiveness and growth underpinned by a strategic business plan and which aim to create and maintain high quality jobs in the blue economy. Projects need to involve in particular the sustainable use of marine resources for innovative and/or circular economic activities and contribute to healthy oceans and Europe’s ‘Green Deal’. They may include deploying, demonstrating, or scaling-up new solutions for the blue economy including technologies, service applications.</p><p>[1] <a href="https://ec.europa.eu/maritimeaffairs/documentation/publications_en">https://ec.europa.eu/maritimeaffairs/documentation/publications_en</a></p><p>[2]<a href="https://publications.europa.eu/en/publication-detail/-/publication/aee1a34c-3b0c-11e9-8d04-01aa75ed71a1/language-en">https://publications.europa.eu/en/publication-detail/-/publication/aee1a34c-3b0c-11e9-8d04-01aa75ed71a1/language-en</a></p>
<p> </p><p>The available call budget is <strong>EUR 22,505,000</strong>.</p><p>This budget might be increased by maximum 20%.</p><p>EASME considers that proposals requesting a contribution in the range <strong>between € 700,000 and €2,500,000</strong> would allow the specific objectives of the Call topic to be addressed appropriately. Nonetheless, this does not preclude submission and selection of proposals requesting other amounts.</p><p>The EU reserves the right not to award all available funds for this call depending on the applications received and the evaluation results.</p>
"}

{"staticAdditionalInfo":"<p>The Commission's economic report on the blue economy in 2020 shows that the maritime sectors present a huge potential[1] to support Europe’s post-crisis economic recovery through innovative products and services creating high-value jobs that shift the EU towards the objectives of the Green Deal.</p><p>However, a market study[2] conducted by the Commission shows that businesses in innovative, sustainable and circular blue economy sectors, while receiving financial support including funding from Horizon 2020, lack support, particularly for SMEs, on the path towards market entry and scaling up.</p><p><span><span>The objective, therefore, is to help close this funding gap by supporting the development and market uptake of new products, services and business models in blue economy value chains, allowing pre-commercial innovations ultimately becoming revenue-generating activities that provide sustainable and innovative blue growth in Europe's sea basins.</span></span></p><p><span><span>[1] </span></span><a href="https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-ld_final.pdf"><span>https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-ld_final.pdf</span></a><span>, </span><a href="https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-annexes-ld-part1_final.pdf"><span>https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-annexes-ld-part1_final.pdf</span></a><span>,</span><br><a href="https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-annexes-ld-part2_final.pdf"><span>https://ec.europa.eu/maritimeaffairs/sites/maritimeaffairs/files/2020_06_blueeconomy-2020-annexes-ld-part2_final.pdf</span></a></p><p><span>[2] </span><a href="https://publications.europa.eu/en/publication-detail/-/publication/aee1a34c-3b0c-11e9-8d04-01aa75ed71a1/language-en"><span>https://publications.europa.eu/en/publication-detail/-/publication/aee1a34c-3b0c-11e9-8d04-01aa75ed71a1/language-en</span></a></p>
<p>The available call budget is <strong>EUR 20 000 000</strong>.</p><p>This budget might be increased by maximum 20%.</p><p>EASME considers that proposals requesting a contribution in the range <strong>between EUR 700 000 and EUR 2 500 000</strong> would allow the specific objectives of the Call topic to be addressed appropriately. Nonetheless, this does not preclude submission and selection of proposals requesting other amounts.</p><p><span><span>EASME reserves the right not to award all available funds for this call depending on the applications received and the evaluation results.</span></span></p>
