{"staticAdditionalInfo":"<p>The Executive Agency for Small and Medium-sized Enterprises, hereafter referred to as "EASME", acting under the powers delegated by the European Commission (also referred as "the Commission"), is launching a call for proposals with a view to concluding grant agreements for projects in the field of environmental monitoring of wave and tidal devices.</p><p>The action covered by this call for proposals forms part of the EMFF Work Programme, whose implementation is delegated to EASME.</p><p>According to the Act of Delegation, grant agreements will be signed by EASME.</p><p>Ocean energy could provide clean, predictable, indigenous and reliable energy and contribute to the EU's objective of reaching a share of renewables of at least 32% of the EU’s gross final consumption by 2030.</p><p><em>The EU is currently the global leader in ocean energy technologies.</em></p><p>The Commission adopted in 2014 a Communication on Blue Energy, which recognised the immense potential of harnessing the power of our seas and oceans. It is also one of the sectors that were identified in the Commission's Blue Growth Communication<u> </u>as an area where EU action can complement initiatives by the Member States to help this nascent industry develop faster and establish a new industrial sector.</p><p>The Ocean Energy Strategic Roadmap “Building Ocean Energy for Europe” published in November 2016 identified de-risking environmental consenting as a key challenge. The development of fit-for-purpose, effective and efficient licensing systems for ocean energy projects across Member States is essential at this stage of development of the sector. This was further confirmed as a priority area for cooperation with member states in the SET Plan Ocean Energy implementation plan adopted by the adopted by SET plan steering committee in March 2018.</p><p>Strategic planning is necessary to prevent future conflicts with other sea users and to ensure minimal impact of ocean energy deployment on the marine environment. Early and coordinated environmental assessment procedures under applicable environmental legislations (Directives on Strategic Environmental Assessment Environmental Impact Assessment, Marine Strategy Framework, Habitats, Birds, NATURA 2000 and Maritime Spatial Planning) and the respective national legal rules are fundamental in ensuring compliance and stakeholders' involvement.</p><p>Developers’ application for consent requires a sound understanding of environmental assessment and processes applied to ocean energy. However, deployments of ocean energy devices are without precedent and there is limited empirical data that could inform the regulatory process. Obtaining consent for an emerging technology such as ocean energy can be time consuming and costly. This also entails the need for public information, consultation and support. Consenting processes, thus, need to be anticipated, tailored and proportionate.</p><p>Close environmental monitoring and impact assessment and an early understanding of these aspects will benefit the current and future deployments of the ocean energy sector as a whole, by putting in place a guiding framework within which to establish protocol for regulatory assessments, licensing, control and monitoring. This will help to steer the transition from research and development to commercial deployment of new technologies.</p><p>This is the second call for proposals in this area launched with support of the EMFF.</p>
<p><em>This call is launched in accordance with the 2019 Work Programme<u> (1) </u>or the Implementation of the European Maritime and Fisheries Fund (EMFF) (section 1.2.1.1 of the annex), on the basis of the objectives set out in the Regulation (EU) No 508/2014 of the European Parliament and of the Council of 15 May 2014 on the European Maritime and Fisheries Fund<u> (2)</u>, and in particular Article 82(c).</em></p><p><em>​(1) </em>Commission Implementing Decision C(2018) 8395 final of 13 December 2018 on the financing of the European Maritime and Fisheries Fund and the adoption of the work programme for 2019, and its annex.</p><p>(2) Regulation (EU) No 508/2014 of the European Parliament and of the Council of 15 May 2014 on the European Maritime and Fisheries Fund and repealing Council Regulations (EC) No 2328/2003, (EC) No 861/2006, (EC) No 1198/2006 and (EC) No 791/2007 and Regulation (EU) No 1255/2011 of the European Parliament and of the Council, Official Journal of the European Union, L 149/1 of 20.5.2014.</p><p><strong>​Budget available:</strong></p><p>The total budget earmarked for this action is <strong>EUR 2 300 000.</strong></p><p>This budget might be increased by maximum 20%.</p><p>The EU grant is limited to a maximum co-funding rate of 80% of eligible costs actually incurred.</p><p>It is estimated that proposals requesting a contribution from the EU of between EUR 800,000 and EUR 1,500,000 would allow the objectives of this call for proposals to be addressed appropriately. The amount requested should be consistent and proportional with the scope of the proposal (number of applicants, number of Member States involved, activities proposed, etc.). Nonetheless, this does not preclude submission and selection of proposals requesting other amounts.</p><p>EASME expects to fund 2 to 4 proposals.</p><p>EASME reserves the right not to distribute all the funds available.</p>
